MERGE INTO songs s
USING (SELECT 'How It’s Done' as title, 5 as artist_id, 1 as album_id, 'https://www.dropbox.com/scl/fi/mi0jg1rknx6e9zxfvpj3r/How-It-s-Done-Official-Lyric-Video-_-KPop-Demon-Hunters-_-Sony-Animation.mp3?rlkey=w0ykc2jysj93hobadi2xeycoz&st=8qok7riv&dl=1' as url FROM dual) src
ON (s.title = src.title)
WHEN MATCHED THEN
  UPDATE SET s.file_path = src.url
WHEN NOT MATCHED THEN
  INSERT (song_id, title, artist_id, album_id, file_path, duration_seconds, genre)
  VALUES (songs_seq.NEXTVAL, src.title, src.artist_id, src.album_id, src.url, 176, '팝, OST');


